  return (
    <Router className = "router">
      <div className = "navbar">
        <Link to ="/">Home ||</Link>
        <Link to ="/expenses">Expenses</Link>
        <Switch>
          <Route exact path = "/">

          </Route>
        </Switch>
    <GlobalProvider>
      <Home />
     <Header />
     <div className = "container">
       <Balance />
       <IncomeExpenses />
       <TransactionList />
       <AddTransaction />
     </div>
    </GlobalProvider>
    </div>
    </Router>
  );
}


export default App;

